import React from "react";
import styled from "styled-components";

const Wrapper = styled.section`
  background-color: var(--nav);
  width: 80%;
  height: 20rem;
  border-radius: 0.5rem;
`;
export default function userNav() {
  return (
    <>
      <Wrapper></Wrapper>
    </>
  );
}
